                                Array.isArray(details_thumbs[d.source.index][d.target.index]) && details_thumbs[d.source.index][d.target.index].length) {                                  
                            var figures = '';

                            for(var k = 0; k < details[d.source.index][d.target.index].length; k++) {
                                figures += "<figure class='details_thumbs-plotapi-chart-f547d9aa'><img src=" + details_thumbs[d.source.index][d.target.index][k] + "><figcaption>" + details[d.source.index][d.target.index][k] + "</figcaption></figure>"
                            }
                    
                            tippy_content = tippy_content + "<br><br><center><span><em>" + figures + "</em></span></center>";
                        }
                    }
                    else if (Array.isArray(details) && details.length) {
                        if (Array.isArray(details[d.source.index][d.target.index]) && details[d.source.index][d.target.index].length) {
                            details_content = details[d.source.index][d.target.index].join(", ");
                            tippy_content = tippy_content + "<br><br><span><em>" + details_content + "</em></span>";
                        }
                    }
                    else if (Array.isArray(details_thumbs) && details_thumbs.length) {   
                        if (Array.isArray(details_thumbs[d.source.index][d.target.index]) && details_thumbs[d.source.index][d.target.index].length) {                                 
                            var figures = '';

                            for(var k = 0; k < details_thumbs[d.source.index][d.target.index].length; k++) {
                                figures += "<figure class='details_thumbs-plotapi-chart-f547d9aa'><img src=" + details_thumbs[d.source.index][d.target.index][k] + "></figure>"
                            }
                    
                            tippy_content = tippy_content + "<br><br><center><span><em>" + figures + "</em></span></center>";
                        }
                    }
                    
                    if(this._tippy == null)
                    {
                        tippy(this, {
                            allowHTML: true,
                            followCursor: true,
                            content: tippy_content,
                            size: "large",
                            arrow: true,
                            maxWidth: 350,
                            theme:'translucent',
                        });
                    }
                };                    
            }

            
            function mouseoutChord(opacityIn, opacityOut) {
                return function (d, i) {
                    d3.select(this.ownerSVGElement)
                        .selectAll("path.chord")
                        .transition()
                        .style("opacity", opacityOut);
                };
            }


            
            
            var plotapi_icon = d3.select("#plotapi-chart-f547d9aa svg")
                .append("svg:a")
                .attr("xlink:href", "https://plotapi.com")
                .attr("target", "_blank")
                .append("image")
                .attr("xlink:href", "https://plotapi.com/gallery/icon/plotapi.svg")
                .attr('width', 20)
                .attr('height', 20)
                .attr('x', width+margin.left + margin.right-20)
                .attr('y', 0)
                .style("opacity", 0)
                .attr("id","plotapi-chart-f547d9aa_icon")

            d3.select("#plotapi-chart-f547d9aa_icon")
                .append("title")
                .text("Produced with Plotapi")

            d3.select("#plotapi-chart-f547d9aa_icon").on("mouseover", function(d, i) {
                d3.select("#plotapi-chart-f547d9aa_icon").style("opacity", 1)
            });

            d3.select("#plotapi-chart-f547d9aa_icon").on("mouseout", function(d, i) {
                d3.select("#plotapi-chart-f547d9aa_icon").style("opacity", 0.6)
            });

            d3.select("#plotapi-chart-f547d9aa svg").on("mouseenter", function() {
                d3.select("#plotapi-chart-f547d9aa_icon").style("opacity", 0.6)
            });

            d3.select("#plotapi-chart-f547d9aa svg").on("mouseleave", function() {
                plotapi_icon.style("opacity", 0)
            });
            

            
            
        }    

    }());
    </script>
